import React from 'react';
import './BluetoothDevice.css';
import { bluetoothOutline, checkmarkOutline, closeOutline } from 'ionicons/icons';

class BluetoothDevice {
  name: string;
  mac: string;
  connected: boolean;
  group: string;

  constructor(name, mac, connected, group){
    this.name = name;
    this.mac = mac;
    this.connected = connected;
    this.group = group;
  }

  ListItem: React.FC<BluetoothDevice> = ({ name }) => {
    return (
      <div className="main-container">
        <strong>{name}</strong>
        <p>Explore <a target="_blank" rel="noopener noreferrer" href="https://ionicframework.com/docs/components">UI Components</a></p>
      </div>
    );
  };

  static connect() {
    return "connected";
  }

  static disconnect() {

  }

}


export default BluetoothDevice;
